import React from 'react';
import Scrollspy from 'react-scrollspy';
import '../../CSS/Navbar.css';
import image from "../../Resources/MacLogo.png";

export default function Navbar() {
    return (
        <nav className="desktop-navigation" style={{boxShadow: '1px 7px 9px #0f0f0f'}}>
                <img src={image} alt="Nothing" style={{width: '60px', height: '60px',marginLeft:'', marginRight: '-16%'}}/>
                <h2 style={{marginRight: '45%', marginLeft: '17%'}}>OffCampus@Mac</h2>
            <div style={{marginLeft: '5%'}}>
            <Scrollspy
                items={['home', 'listings', 'profile', 'aboutus']}
                currentClassName="active">
                <li><a href="#home">Home</a></li>
                <li><a href="#listings">Listings</a></li>
                <li><a href="#profile">Profile</a></li>
                <li><a href="#aboutus">About Us</a></li>
            </Scrollspy>
            </div>
        </nav>
    );
}
